Props:
{
    key: 'tag',
    title: '数据库',
    align: 'center',
    render: row => {
      return h(Naive.NTag, { type: 'success' },  { default: () => row.id });
    }
  }

{
  key: 'e',
    title: '操作',
      align: 'center',
        render: row => {
          return h('div', {
            class: "flex-center gap-8px",
          },
            [
              h(Naive.NButton,
                {   
                  ghost: true,
                  size:"small",
                  type: "primary",
                  onClick: () => {
                    openForm(row.id)
                  }
                },
                $t('common.edit')
              ),
              h(Naive.NPopconfirm,
                {
             
                   onPositiveClick: () => {
                    handleDelete([row.id])
                  },
                },
                {
                  default: () => $t('common.confirmDelete'),
                  trigger: () => h(Naive.NButton,
                    {
                      type: "error",
                      size: "small",
                      ghost: true
                    },
                    $t('common.delete')
                  )
                }

              )


            ]
          )
        }
}

{
    key: 'operate',
        title: $t('common.operate'),
            align: 'center',
                width: 230,
                    render: row => {
                        return h('div', {
                            class: "flex-center gap-8px",
                            onClick: () => {
                                handClick()
                            }
                        },
                            [
                                h(Naive.NButton,
                                    {
                                        ghost: true,
                                        type: "primary",
                                        size: "small",
                                        style: {
                                            display: (row.menuType == Enum.MenuTypeEnum.目录) ? "inline-block" : "none",
                                        },

                                        onClick: () => {
                                            handleAddChildMenu(row)
                                        }
                                    },
                                    $t('page.manage.menu.addChildMenu')
                                ),
                                h(Naive.NButton,
                                    {
                                        ghost: true,
                                        type: "primary",
                                        size: "small",
                                        onClick: () => {
                                            openForm(row.id)
                                        },
                                          style: {
                                            display: (row.menuType != Enum.MenuTypeEnum.按钮) ? "inline-block" : "none",
                                        },
                                    },
                                    $t('common.edit')
                                ),
                                h(Naive.NPopconfirm,
                                    {

                                        onPositiveClick: () => {
                                            handleDelete([row.id])
                                        },
                                    },
                                    {
                                        default: () => $t('common.confirmDelete'),
                                        trigger: () => h(Naive.NButton,
                                            {
                                                type: "error",
                                                size: "small",
                                                ghost: true
                                            },
                                            $t('common.delete')
                                        )
                                    }

                                )


                            ]
                        )
                    }
}

